DROP TABLE IF EXISTS little_pac;
DROP TABLE IF EXISTS nature_pac;
DROP TABLE IF EXISTS pac_county;

CREATE TABLE pac_county(
	pac NUMERIC(6) NOT NULL,
	province VARCHAR(30),
	city VARCHAR(30) NOT NULL,
	county VARCHAR(30) NOT NULL,
	PRIMARY KEY (pac)
);

CREATE TABLE little_pac(
	little_name VARCHAR(255) NOT NULL,
	little_num NUMERIC(2) NOT NULL,
	little_latitude NUMERIC(8,5),
	little_longitude NUMERIC(8,5),
	pac NUMERIC(6) NOT NULL,
	PRIMARY KEY (little_name, little_num),
	FOREIGN KEY (pac) REFERENCES pac_county(pac) ON UPDATE CASCADE
);

CREATE TABLE nature_pac(
	nature_name VARCHAR(255) NOT NULL,
	nature_num NUMERIC(2) NOT NULL,
	nature_latitude NUMERIC(8,5),
	nature_longitude NUMERIC(8,5),
	pac NUMERIC(6) NOT NULL,
	PRIMARY KEY (nature_name, nature_num),
	FOREIGN KEY (pac) REFERENCES pac_county(pac) ON UPDATE CASCADE
);









CREATE FULLTEXT index index_nature_name on nature_pac(nature_name) with parser ngram;

CREATE FULLTEXT index index_little_name on little_pac(little_name) with parser ngram;